import React from 'react';
import "../hojas-de-estilo/Articulos.css";
import ProductoDetalle from './ProductoDetalle';



function Articulos(cantidad){
  let items = [];
  return(
    <div className='con_articulos'>
      <div className='con_articulos_titulo'>
        <span>Cart</span>
      </div>
      <div className='con_articulos_lista'>
        {items.length===0?<div className='empty'><span>Your cart is empty.</span></div>:null}
        
        <ul className='list'>
          {items.map((item) =>(
            <li key={item}>{item}</li>
          ))}
        </ul>
        
      </div>
    </div>
  );
}

export default Articulos;
